rix factorization with biases](https://surprise.readthedocs.io/en/stable/matrix_factorization.html?highlight=matrix%20factorization) on the user-beer review matrix. Each rating is approximated by:]]\u003e\u003c/Text\u003e\u003cFormula\u003e\u003c![CDATA[\\hat r_{user,beer} = \\mu + b_{user} + b_{beer} + q_{beer}^T p_{user}]]\u003e\u003c/Formula\u003e\u003cText\u003e\u003c![CDATA[from wich we recover the biases b_user and b_beer. The reviews are then put into bins of equal frequency in user and beer biases, then approximaely matched by resampling the majoritarian group within each bin. Once the dataset is balanced, we run a t-test to compare the mean rating of local and foreign reviews. We find a small, but significant difference.]]\u003e\u003c/Text\u003e\u003c/Page\u003e\u003c/Pages\u003e\u003c/Report\u003e", width: "", output_is_light_prose: false };
